import React from 'react';
import './App.css';
import Header from './Header';
import Sidebar from './Sidebar';
import Feed from './Feed'
import { selectUser } from './features/userSlice';

function App() {
const user = useSelector(selectUser)

  return (
    <div className="app">
      <Header />

      {!user ? <Login /> : (
        <div className='app_body'>
        <Sidebar />
          <Feed />
          {/* Widgets */}
      </div>
      )}
 
      

    </div>
  );
}

export default App;
